    value: 'Mr. Jeff Pope  Campaign Finance Analyst  Reports Analysis Division  Federal
      Election Commission  999 E Street, NW  Washington, DC 20463    Reference: July
      Quarterly Report (4/24/08 - 6/30/08)    Dear Mr. Pope,    The Lee Terry for
      Congress Campaign committee (FEC ID# C00330811) is in receipt of your letter
      dated August 7, 2008, with respect to the July Quarterly Report.  Please accept
      this amended report and memo as our response to the FECs request for additional
      information.    In regards to item 1, our amended July Quarterly report shows
      the correct election cycle-to-date totals for lines 7(a), 7(c), 17, and 22.  An
      error in our accounting software has been corrected to accurately calculate
      these figures.    In regards to item 2, our amended July Quarterly report shows
      the correct election cycle-to-date totals for donor Mary Joy Anderson.  An error
      in our accounting software has been corrected, which was the reason for the
      discrepancy.    In regards to item 3, our July Quarterly report does show the
      correct itemized receipt totals for the following donors.  Georgianne Colladay
      has contributed a total of $400.00 election cycle to date.  Her first two donations
      were incorrectly listed under her husbands name, Martin Colladay, on the April
      Quarterly report.  That report has been amended (FEC-359470) to show Georgianne
      Colladay as the donor.  Bryan Slone also has contributed a total of $1500.00
      for this election.  Mr. Slones first donation of $1000.00 on 09/27/07 is reported
      in the October Quarterly Report 2007.  Mr. Slones second donation of $500.00
      on 05/12/08 is reported in the July Quarterly Report 2008.      In regards to
      item 4, the committee did file all appropriate 48 hour reports in the pre-primary
      period.  The names in question are spouses who agreed to have the donation that
      was reported in the 48 hour reports reattributed to their name because the original
      donor was over the contribution limit for that cycle.  All reattributions are
      identified in the July Quarterly Report 2008.    The Committee trusts that this
      response sufficiently answers the FECs request for additional information.  Thank
      you.      Sincerely,  Angela Keiser  Treasurer'
